const ArchiveList = ({ archiveMode, archiveList }) => {

  return (
    <div id="archive__list">
      {
        archiveMode === 'place' && (
          <ul>
          {
          archiveList.place.map((place) => (
            <div className="archive__list__item archive__list__item--place">
              <h2 className="archive__list__item__title">{place.title}</h2>
            </div>
          ))
          }
        </ul>
        )
      }
    </div>
  )
}

export default ArchiveList
